import React, { useState } from "react";
import axios from "axios";

function RemoveSizes() {
  const [folderId, setFolderId] = useState(""); // ID of the folder to modify
  const [sizes, setSizes] = useState({}); // Current sizes object
  const [message, setMessage] = useState("");
  const [error, setError] = useState("");

  const fetchSizes = async () => {
    try {
      const response = await axios.get(`http://localhost:3008/info/${folderId}`);
      if (response.data.textFields?.sizes) {
        setSizes(response.data.textFields.sizes);
        setError("");
      } else {
        setError("Sizes data not found for this folder.");
        setSizes({});
      }
    } catch (err) {
      console.error("Error fetching sizes:", err);
      setError("Failed to fetch sizes data.");
    }
  };

  const handleRemoveSize = (color, size) => {
    setSizes((prevSizes) => {
      const updatedSizes = { ...prevSizes };
      if (updatedSizes[color]) {
        updatedSizes[color] = updatedSizes[color].filter((s) => s !== size);
        if (updatedSizes[color].length === 0) {
          delete updatedSizes[color];
        }
      }
      return updatedSizes;
    });
  };

  const handleRemoveColor = (color) => {
    setSizes((prevSizes) => {
      const updatedSizes = { ...prevSizes };
      delete updatedSizes[color];
      return updatedSizes;
    });
  };

  const handleSaveChanges = async () => {
    try {
      const response = await axios.put(`http://localhost:3008/modify/${folderId}`, {
        sizes,
      });
      setMessage("Sizes updated successfully!");
      console.log("Response:", response.data);
    } catch (error) {
      console.error("Error saving changes:", error);
      setMessage("Failed to update sizes.");
    }
  };

  return (
    <div>
      <h2>Remove Sizes and Colors</h2>

      {/* Folder ID */}
      <div>
        <label>Folder ID:</label>
        <input
          type="text"
          placeholder="Enter folder ID"
          value={folderId}
          onChange={(e) => setFolderId(e.target.value)}
        />
        <button onClick={fetchSizes}>Fetch Sizes</button>
      </div>

      {error && <p style={{ color: "red" }}>{error}</p>}

      {/* Current Sizes */}
      {Object.keys(sizes).length > 0 ? (
        <div>
          <h3>Current Sizes and Colors:</h3>
          {Object.entries(sizes).map(([color, sizeArray]) => (
            <div key={color}>
              <strong>{color}</strong>
              <button
                style={{
                  marginLeft: "10px",
                  backgroundColor: "#dc3545",
                  color: "#fff",
                  border: "none",
                  borderRadius: "4px",
                  padding: "5px 10px",
                  cursor: "pointer",
                }}
                onClick={() => handleRemoveColor(color)}
              >
                Remove Color
              </button>
              <div>
                {sizeArray.map((size) => (
                  <span
                    key={size}
                    style={{
                      display: "inline-block",
                      margin: "5px",
                      padding: "5px",
                      backgroundColor: "#f8d7da",
                      color: "#721c24",
                      borderRadius: "4px",
                      cursor: "pointer",
                    }}
                    onClick={() => handleRemoveSize(color, size)}
                  >
                    {size} âœ•
                  </span>
                ))}
              </div>
            </div>
          ))}
        </div>
      ) : (
        <p>No sizes available to display.</p>
      )}

      {/* Save Changes Button */}
      {Object.keys(sizes).length > 0 && (
        <button
          style={{
            marginTop: "20px",
            backgroundColor: "#28a745",
            color: "#fff",
            border: "none",
            borderRadius: "4px",
            padding: "10px 20px",
            cursor: "pointer",
          }}
          onClick={handleSaveChanges}
        >
          Save Changes
        </button>
      )}

      {/* Success or Failure Message */}
      {message && <p>{message}</p>}
    </div>
  );
}

export default RemoveSizes;
